import React from 'react';
import './App.css';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

function App() {
  return (
    <Router>
   <div className="app">
       <Route path="/checkout">
         <h1>Checkout</h1>
       </Route>

       <Router path="/login">
         <h1>Login</h1>
       </Router>

       <Route path="/">
         <h1>Home</h1>
       </Route>


       </div>
    </Router>

  );
}

export default App;
